        public int ReachableNodes(int[][] edges, int maxMoves, int n)
        {
            Dictionary<int, Dictionary<int, int>> graph = new Dictionary<int, Dictionary<int, int>>();
            foreach (int[] edge in edges)   // rebuild graph with dictionary for use convenience
            {
                int u = edge[0], v = edge[1], w = edge[2];
                if (!graph.ContainsKey(u))
                {
                    graph[u] = new Dictionary<int, int>();
                }
                if (!graph.ContainsKey(v))
                {
                    graph[v] = new Dictionary<int, int>();
                }
                graph[u][v] = w;
                graph[v][u] = w;
            }

            Dictionary<int, int> visitedEdge = new Dictionary<int, int>();
            Dictionary<int, int> visitedNode = new Dictionary<int, int>();
            Dictionary<int, int> queuedNode = new Dictionary<int, int>();   // for performance optimization

            Queue<int[]> todo = new Queue<int[]>();
            todo.Enqueue(new int[] { 0, maxMoves });
            while (todo.Count > 0)
            {
                int[] pair = todo.Dequeue();
                int u = pair[0], move = pair[1];
                if (queuedNode.ContainsKey(u) && move < queuedNode[u])  // skip if same node with more move is queued
                {
                    continue;
                }
                visitedNode[u] = move;

                if (!graph.ContainsKey(u) || move == 0) // no more move applicable
                {
                    continue;
                }

                foreach (var neighbor in graph[u])
                {
                    int v = neighbor.Key, w = neighbor.Value;
                    int key = GenKey(u, v), key2 = GenKey(v, u);
                    if (move > w)
                    {
                        visitedEdge[key] = w;
                        if (!queuedNode.ContainsKey(v) || queuedNode[v] < move - w - 1) // only enqueue if more move available
                        {
                            todo.Enqueue(new int[] { v, move - w - 1 });
                            queuedNode[v] = move - w - 1;
                        }
                    }
                    else
                    {
                        visitedEdge[key] = visitedEdge.ContainsKey(key) ? Math.Max(visitedEdge[key], move) : move;
                    }

                    if (visitedEdge.ContainsKey(key2) && move + visitedEdge[key2] > w) // deduplicate overlap nodes
                    {
                        visitedEdge[key] = w - visitedEdge[key2];
                    }
                }
            }

            int r = visitedNode.Count;
            foreach (KeyValuePair<int, int> e in visitedEdge)
            {
                r += e.Value;
            }
            return r;
        }

        private int GenKey(int u, int v) => u * 10000 + v;

        public int ReachableNodes2(int[][] edges, int maxMoves, int n)
        {
            Dictionary<int, Dictionary<int, int>> graph = new Dictionary<int, Dictionary<int, int>>();
            foreach (var edge in edges)
            {
                int u = edge[0], v = edge[1], w = edge[2];
                if (!graph.ContainsKey(u))
                {
                    graph[u] = new Dictionary<int, int>();
                }
                if (!graph.ContainsKey(v))
                {
                    graph[v] = new Dictionary<int, int>();
                }
                graph[u][v] = w;
                graph[v][u] = w;
            }

            return 0;
        }

